theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:180px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:rgba(255, 255, 255, 0); }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section > .elementor-container { height:80px; }
/* sticky-header-color 
=========================*/
.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFFFFF !important; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* site-content-background-color 
=========================*/
.aux-top-header, .aux-sticky-footer .page-title-section, .aux-sticky-footer #main, #inner-body{background-color:#f6f6f6;}
/* product-title-bar-overlay-pattern-opacity 
=========================*/
.single-product .aux-overlay-bg-hash::before { opacity:0.5; }
/* product-setting-section-shop-page-bread-typo 
=========================*/
.woocommerce-page .aux-breadcrumbs > span, .woocommerce-page .aux-breadcrumbs > span a{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:16px; font-weight:bold; line-height:19px; } 
@media(max-width: 1024px){ .woocommerce-page .aux-breadcrumbs > span, .woocommerce-page .aux-breadcrumbs > span a{ font-size:16px; }  } 
/* product-setting-section-shop-page-result-typo 
=========================*/
.woocommerce-page .woocommerce-result-count{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:16px; font-weight:400; } 
@media(max-width: 1024px){ .woocommerce-page .woocommerce-result-count{ font-size:16px; }  } 
/* product-setting-section-shop-page-product-title-typo 
=========================*/
.aux-shop-archive .products-loop .auxshp-loop-title{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:20px; font-weight:600; line-height:24px; } 
@media(max-width: 1024px){ .aux-shop-archive .products-loop .auxshp-loop-title{ font-size:20px; }  } 
/* body-typography 
=========================*/
body{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:20px; font-weight:400; line-height:24px; } 
/* product-setting-section-shop-page-product-price-typo 
=========================*/
.aux-shop-archive .products-loop .price .amount, .aux-shop-archive .products-loop .price ins .amount{ font-family:'Roboto'; color:rgb(213, 178, 98); font-size:25px; font-weight:500; line-height:30px; } 
/* product-setting-section-shop-page-product-excerpt-typo 
=========================*/
.aux-shop-archive .products-loop .aux-shop-desc-wrapper{ font-family:'Roboto'; color:rgb(55, 68, 86); font-size:16px; font-weight:500; line-height:22px; } 
/* product-setting-section-shop-page-product-reg-price-typo 
=========================*/
.aux-shop-archive .products-loop .price del,  .aux-shop-archive .products-loop .price del .amount{ color:rgb(175, 181, 188); font-size:15px; line-height:18px; } 
/* sidebar-common-widget-title-typography 
=========================*/
.aux-sidebar .widget-title{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:16px; font-weight:400; text-transform:capitalize; text-decoration:none; line-height:19px; letter-spacing:-0.5px; } 
/* sidebar-primary-widget-title-typography 
=========================*/
.aux-sidebar-primary .widget-title{ font-family:'Roboto'; font-weight:400; font-size:16px; line-height:19px; color:rgb(40, 48, 64); text-transform:capitalize; } 
/* sidebar-secondary-widget-title-typography 
=========================*/
.aux-sidebar-secondary .widget-title{ text-decoration:none; font-size:168px; font-style:normal; color:rgb(0, 0, 0); } 
/* sidebar-global-typography 
=========================*/
.aux-sidebar{ font-family:'Roboto'; font-weight:400; font-size:16px; line-height:19px; text-decoration:none; text-transform:none; color:rgb(229, 229, 229); } 
/* product-setting-section-single-appearance-title 
=========================*/
.single-product .entry-title{ font-family:'Playfair Display'; font-weight:800; font-size:45px; line-height:60px; color:rgb(40, 48, 64); } 
/* product-setting-section-single-appearance-price 
=========================*/
.single-product .price .amount, .single-product .price ins .amount{ font-family:'Roboto'; color:rgb(213, 178, 98); font-size:35px; font-weight:400; } 
/* product-setting-section-single-appearance-add-to-btn 
=========================*/
.single-product .cart .auxshp-add-to-cart{ font-family:'Roboto'; color:rgb(255, 255, 255); font-size:20px; font-weight:500; text-transform:uppercase; line-height:24px; } 
/* product-setting-section-single-appearance-reg-price 
=========================*/
.single-product .price del .amount, .single-product .price del{ color:rgb(175, 181, 188); font-size:20px; } 
/* product-setting-section-single-appearance-tabs-title 
=========================*/
.woocommerce-page .woocommerce-tabs .tabs li a{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:30px; font-weight:bold; line-height:37px; } 
/* header-main-menu-typography 
=========================*/
.site-header-section .aux-menu-depth-0 > .aux-item-content .aux-menu-label{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:16px; font-weight:600; text-transform:capitalize; font-style:normal; line-height:19px; } 
/* comment-forms-label-typo 
=========================*/
#commentform label{ font-family:'Lato'; } 
/* product-related-posts-title-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .auxshp-loop-title{ font-family:'Roboto'; font-size:20px; line-height:24px; font-weight:700; color:rgb(40, 48, 64); } 
/* product-related-posts-price-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .price .amount , .aux-widget-related-products .auxshp-entry-main .price ins .amount{ line-height:25px; font-size:25px; font-weight:400; } 
/* product-related-posts-reg-price-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .price ins del,  .aux-widget-related-products .auxshp-entry-main .price del .amount{ font-family:'Roboto'; color:rgb(175, 181, 188); font-size:15px; font-weight:400; } 
/* product-related-posts-excerpt-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .aux-shop-desc-wrapper{ font-family:'Roboto'; color:rgb(40, 48, 64); font-size:16px; font-weight:400; line-height:19px; } 
/* product-related-posts-label-typo 
=========================*/
.single-product .auxshp-related-products .widget-title{ font-family:'Playfair Display'; color:rgb(10, 10, 10); font-size:70px; font-weight:800; line-height:90px; } 
/* product-setting-section-shop-page-product-meta-fields 
=========================*/
.aux-shop-archive .products-loop .aux-shop-meta-fields span{ font-size:16px; } 
/* product-setting-section-shop-page-product-btn-typo 
=========================*/
.aux-shop-archive .products-loop .loop-tools-wrapper .button{ font-size:16px; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-size:16px; } 
@media(max-width: 1024px){ body h5, body .aux-h5{ font-size:16px; }  } 
/* content-typography 
=========================*/
body { font-family: "Roboto";font-weight: regular; }
/* main-title-typography 
=========================*/
h1, h2, h3, h4, h5, h6, .aux-h1, .aux-h2, .aux-h3, .aux-h4, .aux-h5, .aux-h6 { font-family: "Roboto";font-weight: 300; }
/* page-title-typography 
=========================*/
.page-title { font-family: "Roboto";font-weight: 300; }
/* header-menu-typography 
=========================*/
.aux-master-menu { font-family: "Roboto";font-weight: regular; }
/* buttons-typography 
=========================*/
.aux-button { font-family: "Roboto";font-weight: regular; }
/* product-setting-section-single-appearance-category 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-label{ font-family:'Roboto'; font-size:20px; color:rgb(40, 48, 64); font-weight:500; line-height:24px; } 
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* product-single-wishlist-button-icon-size 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon::before { font-size:25px; }
/* product-single-share-button-icon-size 
=========================*/
.single-product .aux-share-btn span::before { font-size:25px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #c18b5b;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #b57e51;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #a0673e;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #d5b262;}
/* site-featured-color-5 
=========================*/
:root{--auxin-featured-color-5: #fb1d52;}
/* site-featured-color-6 
=========================*/
:root{--auxin-featured-color-6: #f6f6f6;}
/* site-featured-color-7 
=========================*/
:root{--auxin-featured-color-7: #283040;}
/* site-featured-color-8 
=========================*/
:root{--auxin-featured-color-8: #a4abb5;}

